import React from 'react';
import { Button, Container } from 'semantic-ui-react';
import { Link } from 'react-router-dom';

const NavBar = ({ history, currentUser, logout, signUp }) => {
  const authLinks = (
    <Container>
      <Link color='red' onClick={() => history.push('/search')}>
        Search
      </Link>
      {currentUser && (
        <Link as='icon' color='red' onClick={() => history.push('/profile')}>
          Profile
        </Link>
      )}
      {currentUser && (
        <Link color='red' onClick={logout}>
          Logout
        </Link>
      )}
    </Container>
  );

  const guestLinks = (
    <Container>
      <Link as='button' color='red' to={'/login'}>
        Login
      </Link>

      <Link as='button' to={'/signup'} color='red'>
        SignUp
      </Link>
    </Container>
  );

  return <>{currentUser ? authLinks : guestLinks}</>;
};
export default NavBar;
